	public static int find(String input){
		if(input == null || input.equals("")){
			return 0;
		}
		HashSet<Character> hs = new HashSet<>();
		Queue<Character> q = new LinkedList<>();

		char[] inputChars = input.toCharArray();
		int currentMax = 0;
		for(int i=0 ; i<inputChars.length ; ++i){
			char c = inputChars[i];

			if(!hs.contains(c)){
				hs.add(c);
				q.offer(c);
				//check size
				if(q.size() > currentMax){
					currentMax = q.size();
				}
			}
			else{
				while(q.peek()!=c){
					char removedChar = q.poll();
					hs.remove(removedChar);
				}
				char removedChar = q.poll();
				q.offer(c);
				
			}
		}

		return currentMax;
	}

